import React, { Component } from 'react';
import { Button } from 'mdbreact';
import './ochain.css'

class Beneficios extends Component {
  render(){
    return(

<div className='text-align'>
<h4 className="mt-5 mb-2">Tecnologia disruptiva <br/> gere mais valor para a sua marca utilizando nossos serviços</h4>
<p>
  <ul>
    <li>Benefícios</li>
    <li>Geração de valor</li>
    <li>Confiabilidade</li>
    <li>Mais leads</li>
    <li>Unbound marketing</li>
  </ul>
</p>
 <Button color="success">Veja nossos feedbacks</Button>
      </div>
    );
  }
}

export default Beneficios;
